        <Route path="/" element={<TodoList />} />
         {/* <Route path="/tasks/:taskId" element={<TaskDetails />} />  */}
        <Route path="/tasks/:taskId" element={<TaskDetails tasksToDisplay={data} />} />
        <Route path="/about" element={<About />} />
        <Route path="*" element={<NotFound />} />
      </Routes>

      <Footer />
    </div>
  );
}

